pragma solidity ^0.8.3;
contract Counter
{
    
    uint  counter;

    function inc() public
    {
        counter++;
    }
    function dec() public
    {
        counter--;
    }
    function getcount() public view returns (uint)
    {
        return counter;
    }
}

